#pcos #healthyeating #pcosdiet #pcosfighter #pcoslifestyle";}i:4;a:1:{s:14:"comments_count";i:0;}i:5;a:1:{s:11:"likes_count";i:2;}i:6;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvCpaPhKTk";}i:7;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118781937_729523760930488_1909928252960184304_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=QsU-3gKhPPEAX_gvBiI&oh=33a097a4129b0c23e74a149587d7d5fc&oe=5F7D725D";}i:8;a:1:{s:4:"type";s:5:"image";}i:9;a:1:{s:8:"owner_id";i:20839548;}i:10;a:1:{s:14:"owner_username";s:0:"";}i:11;a:1:{s:14:"owner_fullname";s:0:"";}i:12;a:1:{s:9:"owner_pic";s:0:"";}i:13;a:1:{s:2:"id";s:19:"2391125574216512741";}i:14;a:1:{s:10:"short_code";s:11:"CEu_AqAhvTl";}i:15;a:1:{s:12:"created_time";i:1599264402;}i:16;a:1:{s:7:"caption";s:2149:"#HonestyPost I had another night of binging and my stomach is hurting a little bit. My mental health isn't at its best right now. As well as how traumatic and damaging these last few years have been, on top of that there is heartbreak, loss and grief. I've always said the last 4 months of the year is my favourite, but this year it will be a little bittersweet for me. I can't help but think of whatever I'm doing, I'm doing without this person. And it was around this time last year that she came into my life. So I think of the things I'm doing right now. The things ahead of me. Without her. 

And today has also been something of a difficult anniversary. Though I question how much of an impact it had on me today - I've had some years where the date has gone past and I only realise after. 

I've been so open about pretty much everything but never really talked about this moment as much. 4th September 2009. It was also a Friday. I was in a very bad place and felt I couldn't be anywhere without any doctors around me right then. I voluntarily went into the psychiatric ward. I ended up only being there for 5 days. And though I thought I needed it, I also kept thinking I shouldn't be there. I'm just wasting everyone's time there and the doctors and nurses probably think that too. I'm not a serious case. And when my parents found out, though they were trying to be supportive and cared for me in their own way, there was still some anger at me. They were also quick to tell me that my late nights were the cause of this and I should listen to them. 

It's a time I look back on with some guilt. That feeling that I'm just a fraud and shouldn't have been there in the first place. It only ended up being 5 days. And it further feeds that voice in my brain telling me how invalid every thought and feeling I have is. How I'm being overdramatic and attention seeking. That the people at the psychiatric ward were just humouring me and allowing me to live in my delusion that I needed to be there.

I honestly don't know exactly where I'm going with telling this story haha. But it's what's been on my mind today and it's part of my journey.";}i:17;a:1:{s:14:"comments_count";i:1;}i:18;a:1:{s:11:"likes_count";i:4;}i:19;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu_AqAhvTl";}i:20;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118726882_310166000243550_7178013213215396705_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=8s5HrPl1vm8AX8e-5LP&oh=90694e6841d4c39506541dcd87f8f24b&oe=5F7AB92A";}i:21;a:1:{s:4:"type";s:5:"image";}i:22;a:1:{s:8:"owner_id";i:10963398138;}i:23;a:1:{s:14:"owner_username";s:0:"";}i:24;a:1:{s:14:"owner_fullname";s:0:"";}i:25;a:1:{s:9:"owner_pic";s:0:"";}i:26;a:1:{s:2:"id";s:19:"2391116423503292903";}i:27;a:1:{s:10:"short_code";s:11:"CEu87fvhCnn";}i:28;a:1:{s:12:"created_time";i:1599263311;}i:29;a:1:{s:7:"caption";s:420:"Basically I‚Äôve just deleted over 1000 posts on my feed dating back to 2017 & started fresh! 
